import React from 'react';
import './Sidebar.css';
import DonutLargeIcon from '@material-ui/icons/DonutLarge';

function Sidebar() {
  return (
    <div className='sidebar'>
      <div className='sidebarHeader'>

        <div className='sidebarHeaderRight'> </div>
          <DonutLargeIcon />
      </div>
    </div>
  );
}

export default Sidebar;
